(96,	17,	'34',	'第100章：原则性问题',	'pertanyaan prinsip hidup',	'他的吻几乎让她窒息，在最后快要溺水的时候才肯放过她。\r\n\r\n顾敏一下子涨红了脸庞，被他强吻过后，更是咳嗽了起来，“咳咳！”\r\n\r\n顾敏呛得眼中都是雾蒙蒙的，更是抬不起头来。\r\n\r\n然而她的下颚，却被他捏住抬起。\r\n\r\n一下子，就对上了他阴鹫的双眸，用一种狠厉冷漠的眸光瞧着她，“吃好这顿饭，你给我立刻回去！”\r\n\r\n顾敏快窒息了，她根本说不出话来。\r\n\r\n“听见了没有！”他又是喝了一声，低沉无比。\r\n\r\n“……听见了……”她有些被吓到了，轻声回应。\r\n\r\n他这才松开了手，一下转身翩然而去。\r\n\r\n顾敏却还僵在原地，口腔里都是他的味道，混合不清的，搅乱她的一切。\r\n\r\n两人一前一后回了包间，倒也没有引起旁人的注意。\r\n\r\n在这之后，一切照旧进行着，他们三人在谈笑，而顾敏却再也没有多说什么。\r\n\r\n从餐厅出来夜色渐深，徐怡静笑着问道，“嗨，晚上有什么活动介绍吗？”\r\n\r\n夏译于是道，“我知道最近有几部电影不错。”\r\n\r\n“如何？”徐怡静扭头望向了唐仁修。\r\n\r\n他眼中温润一片，笑着说道，“是不错。”\r\n\r\n只是悄然之间，唐仁修的目光不着痕迹地对上了顾敏，深邃的，沉闷的，却惊动心弦。\r\n\r\n顾敏心里咯噔了一下。\r\n\r\n双方招呼几句，各自上车离去。\r\n\r\n车子里，徐怡静随意聊着，笑着询问，“那我们去看哪部电影呢？”\r\n\r\n车子吃到红灯停了下来，唐仁修才歉然笑道，“抱歉，我临时有点急事要处理，不能陪你看电影了。”\r\n\r\n“哦……”徐怡静的笑容微僵又迅速恢复，不免感到失望，“没关系，那下次好了。”\r\n\r\n“我送你回去。”\r\n\r\n“好。”\r\n\r\n车子又往行驶，透过前车镜，唐仁修瞧见身后的两道身影，远去消失不见了。\r\n\r\n而在酒店前，顾敏和夏译还站在那儿。\r\n\r\n夏译小心翼翼却又满怀期待问道，“那要不我们去看电影吧？”\r\n\r\n顾敏蹙眉，扭头望向了他。\r\n\r\n只见他还一脸期许等待的样子，这让她感到内疚，但是她还是坚定了信念道，“夏译，我以为之前我已经说的很明白了。”\r\n\r\n“我们是不可能的，真的。”顾敏的声音轻而坚决，那眼神亦是。\r\n\r\n夏译眼中的光芒全都褪去了，只剩下惆怅，他更是抱歉，“对不起，是我太急躁了，让你不自在了，下次不会了……”\r\n\r\n“不，夏译，你还是不明白，我是不会和你在一起的，你知道吗？”她再次拒绝，彻底明了。\r\n\r\n夏译此刻除了失落之外，却还有不甘，他懊恼说道，“我没有想要勉强你，我只是想慢慢接近你。可是为什么，你连这样都要拒绝呢？顾敏，你真的连一次机会也不愿意给我吗？”\r\n\r\n“不愿意。”她立刻回答，简洁直接到让他错愕。\r\n\r\n“夏译，我有喜欢的人了！”下一秒，她又是重声。\r\n\r\n“那个是谁呢？你没有男朋友不是吗？”夏译有些急躁起来，“为什么要这么执着一个人呢？”\r\n\r\n顾敏却是淡淡笑着，眼神明亮而坚定，“夏译，谢谢你，真的。但是，我是不可能会喜欢上你的。哪怕我没有男朋友，也绝对不可能。”\r\n\r\n夏译的心绪紊乱，耳边更是隆隆作响，在灯光夜色下，在错乱的光线里，他看见顾敏微笑着，那么温暖的笑容，带着明媚而期许的眼神，是庆幸是注定，是不容人再进入的世界。\r\n\r\n“因为，我已经遇见他了。”随后，他听见她轻声说。\r\n\r\n夏译一下子愣住，回不过神来。\r\n\r\n只瞧见她朝他挥了挥手，轻声一句，“拜拜。”\r\n\r\n那抹身影，越走越远，从他的世界里远去。\r\n\r\n夏译还站在原地，只瞧着她奔跑过马路消失了。\r\n\r\n终于，再一次的，从他的世界里消失了。\r\n\r\n顾敏回到公寓的时候，发现客厅里的灯亮着。\r\n\r\n她有些一惊，换了拖鞋走过玄关一瞧，只见唐仁修就坐在沙发里。他的视线也在瞬间对上了她，指尖燃着一支烟，用一种低沉的不明情绪的声音慢慢悠悠的开口询问，“我不是让你立刻回来，怎么这么慢？”\r\n\r\n顾敏懊恼，轻声说道，“正好看见有公车，我就坐公车回来的。”\r\n\r\n“现在这么晚了，还有公车？”\r\n\r\n“最后一班是十点半，现在才九点。”\r\n\r\n她回答的有理有据，唐仁修眼眸一凝，“你不是告诉我，和那位老同学都已经说清楚了？”\r\n\r\n“是说清楚了。”\r\n\r\n“那还一起去吃饭去看电影？”\r\n\r\n“是你让我一起去吃饭的。”顾敏辩驳，“至于电影，根本没有看。”\r\n\r\n前者，唐仁修无法反驳，但是后者，“如果我不让你立刻回来，你不就会去看了？”\r\n\r\n“当然不会！”顾敏立刻回答。\r\n\r\n“不会最好！”他眼眸一凝，瞧见她那张小脸被冷风冻得鼻尖又红了，他又是喝道，“现在回房间去！”\r\n\r\n“我有话要对你说……咳咳……”顾敏还是鼓起了勇气，决心要和他谈谈。\r\n\r\n“我让你回房间去！”唐仁修却是失了耐心，只觉得那咳嗽声真是刺耳。\r\n\r\n“说完我再去！”顾敏也犟上了，更是打了个喷嚏，“阿嚏！”\r\n\r\n唐仁修眉宇一凛，俊脸沉凝，抽了口烟道，“好，你说！”\r\n\r\n顾敏垂眸，而后又抬起，望着他道，“今天晚上，我们在电梯口是偶遇，因为在一个公司，难免会遇到的，也根本不是你所想的，什么约好了一起吃饭看电影，根本没有这一回事。”\r\n\r\n“还有，把夏译除名这件事情，我觉得你做的不对，不应该这样。”顾敏屏气凝神，终究还是把话给说了出来。\r\n\r\n吞吐出白色烟圈，唐仁修扬起唇角，却是笑了。\r\n\r\n他幽幽一句，让顾敏瞠目，“你再多说一句，我立刻让他在港城消失！”\r\n\r\n……\r\n\r\n如果不是司机小郑，那么顾敏还不知道他的去向。原来不是工作忙碌，所以提早去上班了。\r\n\r\n而是——\r\n\r\n“您说仁总吗？他今天一早去国外了。”小郑在前方开着车，笑着回道。\r\n\r\n出国了？\r\n\r\n顾敏错愕，他根本就没有提过。\r\n\r\n而且，也没有说过。\r\n\r\n顾敏有些诧异，又是问道，“那他大概几天回来呢？”\r\n\r\n“这个我就不清楚了……”小郑摇了摇头。\r\n\r\n顾敏的心里却是更加不宁了，这下终于肯定，他是生气了。\r\n\r\n车子转过转角，小郑在前方又是说道，“顾小姐，仁总有吩咐我，让我送您回家之前，先去医院。”\r\n\r\n去医院？顾敏顿时眼眸一凝，心里莫的一暖。\r\n\r\n从医院回来，顾敏握着手机思来想去，还是决定要给他打个电话。至少，也得问问他什么时候回来。\r\n\r\n心念一定，按着号码便拨了过去。\r\n\r\n而后接通了，顾敏的心突然被揪紧了似的，很紧张。\r\n\r\n“什么事。”他低沉的声音传来，简洁的三个字。\r\n\r\n从电话那头依稀夹杂着旁人的声音，大概是在忙，顾敏这下懊恼，她怎么就没有算算时差，看看他是不是有空呢，她赶紧道，“你在忙吗？”\r\n\r\n“有事就说！”他又问了一遍。\r\n\r\n“我刚刚听小郑说了，你去国外了。”\r\n\r\n“你现在是来兴师问罪，怪我没有提前告诉你吗？”\r\n\r\n“不是……”\r\n\r\n那头的他却是改了流利的英文，又和旁人吩咐了一句，接着又是冲她质问，“那你打电话给我，到底是什么事情！”\r\n\r\n顾敏的声音轻了几分，急急说道，“我只是想问问你，这次出差要几天，什么时候回来？”\r\n\r\n忽然的一阵沉默，她不禁轻握住手机。\r\n\r\n而那头又是旁人的声音夹杂而起，顾敏也觉得不妥，“你忙吧，我先挂了。”\r\n\r\n“七天！”他却突然回了一句。\r\n\r\n顾敏一怔，眼中有了一丝欣喜，“好，我知道了，那拜拜。”\r\n\r\n……\r\n\r\n这日陶思甜约了她一起出来聚聚。\r\n\r\n在询问之下，顾敏就说起了夏译的事情。\r\n\r\n“我真是佩服，那个夏译，他能暗恋你那么多年，还鼓起勇气来告诉你！怪不得呢，我记得当时他对你挺好的，无事献殷情，原来是因为这个！这是多么的缠绵悱恻滔滔不绝啊！”\r\n\r\n“不过，唐学长这招更狠哈，竟然直接把夏译给除名了！啧啧，公报私仇原来也可以这么帅！”陶思甜兴奋地嚷嚷，简直将这一出看成了偶像剧。\r\n\r\n顾敏蹙眉喊了一声，“思甜！”\r\n\r\n“好好好，现在回归正题！”陶思甜不打岔了，说到了正题。\r\n\r\n“我觉得男人遇见这种事情，不在意是不可能的！除非，他不喜欢你！所以，唐学长一定是在心里闹别扭！再说了，他这样做，也是在乎你的一种表现不是吗？”\r\n\r\n陶思甜的话语，顾敏也是认同，可是却依旧有小小的固执，“我还是觉得他把夏译除名，这种做法不对，他不应该这样。”\r\n\r\n“哎，你的胆子好大，还敢当他的面这么说，他估计要气死了。”陶思甜也佩服她，也是狐疑，“小敏，你说你平时这么温温柔柔的一个人，怎么在夏译这件事情上，这么固执呢？”\r\n\r\n顾敏蹙眉，那张小脸上，有着一抹不可挥去的坚定。\r\n\r\n“原则性问题，不能妥协。”顾敏轻声道。',	'Ciumannya hampir mencekiknya, dan dia hanya rela melepaskannya ketika dia hampir tenggelam.\r\n\r\nWajah Gu Min tiba-tiba memerah, dan setelah dicium olehnya, dia bahkan terbatuk, \"Batuk!\"\r\n\r\nGu Min tersedak kabut di matanya, dan bahkan tidak bisa mengangkat kepalanya.\r\n\r\nNamun, rahang bawahnya dicubit dan diangkat olehnya.',	3043,	54.77,	NULL,	10,	10,	1,	0,	1,	'2022-09-08 13:43:52',	'2022-10-02 14:56:27'),
(97,	17,	NULL,	'bab 100',	NULL,	'“看了这么久的戏，你是不是差不多也该出来了？”\r\n\r\n一路来到琉华街口。萧晨却你并没有立马上车，撇眼落在身后的阴影之中，清淡道。\r\n\r\n话音落，立刻就从阴影之内走出了几条人影，都蒙着面。\r\n\r\n这时，车内的铁策才发现周围居然还有这么几个人存在。\r\n\r\n高低矮瘦各不相同，不过为首的那个显然是个女子。\r\n\r\n没有多话，女子直接挥手给身后的同伴打了个手势。\r\n\r\n看着同伴离开，女子才抬手摘下了脸上的遮掩，露出了那张美丽却熟悉的容颜。\r\n\r\n“张，张小姐？”揉了揉肉眼睛，铁策似乎还有些不太相信。\r\n\r\n萧晨却并不意外，一屁股坐在车头，看着张筱筱道：“大半夜的不睡觉，容易长皱纹！”\r\n\r\n“你就不能说点好听的？”张筱筱翻了个白眼，没好气地说道。\r\n\r\n说着已经来到了萧晨身边，扭头看着看着这条琉华街，好看的眉头缓缓拧在了一起。\r\n\r\n“沐家这些混蛋，下手还真够狠的！”\r\n\r\n“老爷子不是说，张家和底下世界那一套套的没干系吗？你跑来干什么？”\r\n\r\n“我要是说担心你，你信吗？”张筱筱咧嘴丢下一句，脸色却随之一整，“人家都闹到咱们家门口了，作为主人家还不得出门瞧瞧？”\r\n\r\n这话，也就只有身为张家千金的张筱筱敢这么说。\r\n\r\n就是不知道江龙和丛虎那个死鬼，要是听到，又是怎么个表情。\r\n\r\n“这话似乎不该你说，现在这里，是我家门口才对！以后要串门，记得先打个招呼。”\r\n\r\n萧晨平淡地说道。\r\n\r\n但那清淡的语气，却没能掩饰其中警告的意味儿。\r\n\r\n张筱筱全程旁观，对于萧晨的提醒也并不意外。不过心里还是有那么一点不舒服。\r\n\r\n这次对张家来说也一样是个机会.\r\n\r\n要是萧晨不来，龙翼堂也好、双河会也罢，一定都是张家的囊中之物.\r\n\r\n可惜，萧晨这家伙太强，他们连插手的机会都没有。\r\n\r\n当然，也就现在她才在心里埋怨两句。\r\n\r\n之前得知沐家找上双河会，找上丛虎，张家就已经觉察了异常。\r\n\r\n所以丛虎带人这么一行动，张家老爷子立刻就派了人赶了过来。\r\n\r\n只是张家做的一向都是正经生意，对于收纳龙翼堂、双河会之流并没有多大兴趣。\r\n\r\n不然，丛虎发动之初，张筱筱就带人参战，也不会让江龙遭这么一大场罪。\r\n\r\n对张筱筱来说，目的只有一个，那就是全歼沐家派来的这几个精锐。\r\n\r\n至于对龙翼堂和双河会的处置，那都是后话、\r\n\r\n“还有两个喘气的，你能不能交给我？”\r\n\r\n张筱筱吸了口气，终究是没有接萧晨的腔，兀自转移了话题。\r\n\r\n“如果换个时候，交给你们就是了，不过那两个人，我还有用。”\r\n\r\n萧晨拒绝了张筱筱，既然在这个时候接下龙翼堂，以后和沐家的交道是少不了的。\r\n\r\n这两个沐家残党对他有用，所以这一次不会那么轻易交出去。\r\n\r\n张筱筱微微有些失望。\r\n\r\n“不过你放心，要是挖出沐家什么秘密，我会让人复印一份送到张府。”\r\n\r\n“呼”闻言，张筱筱才吁了口气，笑着道：“那可就这么说定了！”\r\n\r\n“对了，凌晨我让顾长风送到张家的那具尸体，有查出什么吗？”\r\n\r\n死了人，当然不能就那么放在医院，顾长风一醒，萧晨就让他招呼人把鬼桀送了出去。\r\n\r\n对于如今的修炼界，显然张家比顾家知道得多。\r\n\r\n鬼桀能操控尸煞，并且掌握了驭煞法诀，显然不会是普通人，所以萧晨联系了张家接手。\r\n\r\n听说鬼桀或许掌握了某种完整传承，张家一下子就来了兴趣。\r\n\r\n连夜把尸体带走，直接扔进了张氏的秘密实验室里。\r\n\r\n不过，萧晨对于鬼桀那所谓的传承是半点兴趣也没有，他在乎的只有鬼桀的来历。\r\n\r\n当然，那份在乎也就只有那么一点而已。不然也不会果断要了鬼桀小命儿了。\r\n\r\n此刻正好遇到了张筱筱，所以才顺嘴提了那么一句。\r\n\r\n“没有能查出身份的东西，不过听你之前所说，那个鬼桀或许来自湘西肆魔门。”\r\n\r\n“肆魔门？”\r\n\r\n“也就是一个不入流的小门派，都是一群装神弄鬼之人，修炼界除了他们自己，也没人承认他们隐世宗门的身份。”\r\n\r\n说起这个，张筱筱也是一脸不屑。没等萧晨继续追问，她就自顾自地给他解释了起来。\r\n\r\n所谓肆魔门，乃是不为修炼界所容的一群人。\r\n\r\n修武者自有其高傲，但肆魔门中人所做所谓都为修炼界中人不齿。\r\n\r\n这些家伙不仅到处刨人家祖坟，还自己振振有词。\r\n\r\n每次和人打架偏偏又溜得比老鼠还快。末了还转过头来使阴招。\r\n\r\n要是修炼界还承认他们，那简直就是自降水准，所以久而久之，肆魔门就被隐宗除名。\r\n\r\n可肆魔门之人对于除名之事不屑一顾，对外依旧以隐宗之一号称。\r\n\r\n“原来如此。”萧晨点了点头，自然也没把这群人放在眼中。\r\n\r\n“虽然那些家伙风评不怎么样，但对自己人却极为护短，这一次你宰了他们的人，他们只怕没那么容易善罢甘休。”张筱筱却不由提醒了一句。\r\n\r\n正因为这样，肆魔门也被看成是一块狗皮膏药，就是修炼界也没人愿意轻易招惹。\r\n\r\n倒不是说肆魔门有多强，主要是那些家伙太不要脸，缠人还烦。\r\n\r\n“我还怕他们不来呢。”萧晨淡然一笑，也没再和张筱筱多说，拉开车门坐了进去。\r\n\r\n铁策也和张筱筱招呼了一声，利索地发动了引擎。\r\n\r\n车子呼啸两声，就从街口离开。\r\n\r\n“这家伙居然能和肆魔门的人一样，操控魔煞，这事儿必须告诉爷爷。”\r\n\r\n张筱筱也没有耽搁，跟着调转了身影，只是几个闪身也从街口消失。\r\n\r\n这头车上，铁策却时不时拿眼睛看在萧晨面上，好几次都欲言又止。\r\n\r\n“想说什么就说。”萧晨自然也注意到了铁策的模样，淡声道。\r\n\r\n“先生，我想和你学本事儿，还请先生教我！”\r\n\r\n虽然铁策没有进入大楼，可也在外面看到了楼里的战斗。\r\n\r\n那份震骇，到现在已经逐渐演变成了火热和憧憬，深深地看着萧晨，希冀地说道。',	NULL,	1800,	NULL,	NULL,	NULL,	0,	0,	1,	0,	'2022-09-18 13:44:23',	'2022-09-18 13:44:23'),
(98,	17,	NULL,	'bab 99',	NULL,	'“剧场？电影院？我看上去像是买不起的人吗？”萧晨翘着二郎腿，淡眼落在江龙脸上。\r\n\r\n微微一滞，江龙眼皮子抽了抽，急忙改口道：“当然不是，是我嘴欠，说错话了！”\r\n\r\n萧晨却已经转头落在了丛虎脸上，淡声道：“你告诉他，我缺那几个钱吗？”\r\n\r\n“不，不缺，当然不缺。”\r\n\r\n丛虎想哭的心都有了，第一时间就想到了那一个亿欠条。\r\n\r\n但现在却不是心疼那两个钱的时候。\r\n\r\n他很清楚，他也好，江龙也罢，他们的小命也都不过在萧晨的一念之间。\r\n\r\n反正已经死了这么多人，对萧晨而言，多死一个两个绝不会有什么区别。\r\n\r\n“先生放心，那一个亿，我一定尽快，尽快送您府上。”\r\n\r\n为了稳住萧晨，丛虎急忙保证道。\r\n\r\n闻言，江龙却眉眼一闪，似乎抓住了些什么。\r\n\r\n“一个亿，又算什么，先生只要能帮我杀了丛虎这个混蛋，我愿意献出两亿给您！”\r\n\r\n说到动心眼，江龙显然比起这个丛虎更胜一筹。\r\n\r\n可丛虎也不是笨蛋，听到这话，简直恨不得立马把江龙给掐死。\r\n\r\n只要他丛虎死了，双河顺理成章的就会成为龙翼堂的产业。\r\n\r\n到那个时候，别说两个亿，双帮合一，三个亿凑凑只怕也不成问题。\r\n\r\n“先生别听他胡说，就凭他岂能拿出那么多钱。都是想欺瞒先生！”\r\n\r\n“是吗？你在骗我？”萧晨眼神一定，徐徐落在了江龙身上。\r\n\r\n冷清的目光，却让江龙心头一凉。\r\n\r\n“先生明察秋毫，神威盖世，就是借一万个胆子给江某，我也绝不敢欺骗先生！”\r\n\r\n“姓江的，当着先生的面，你居然还敢花言巧语，现在我就替先生教训教训你！”\r\n\r\n丛虎却已经忍不下去了，迟则生变，这会儿他只想先下手为强。\r\n\r\n说着话，短刀一甩，立马照着江龙脑袋这捅了下去。\r\n\r\n“先生明鉴，小的绝不是胡言乱语，给我两天时间，两天内，我一定把……”\r\n\r\n“哼，还不给我闭嘴！”丛虎脸色暴怒，生怕萧晨被江龙诱惑。\r\n\r\n江龙一脸惨白，直勾勾地盯着萧晨，萧晨却半点没有松口的意思。\r\n\r\n眼看那把刀锋越来越近，江龙心头狂跳，狠狠咬了咬牙，再一次开了口。\r\n\r\n“只要先生救我，我愿奉先生为主，以后整个龙翼堂，乃至整个金兰地下，都是先生的！”\r\n\r\n江龙下了很大的决心，如果两亿都还不能打动萧晨，他能想到的也就只有这个底牌了。\r\n\r\n比起死亡，或许拜入萧晨这么一个强人手下，会是一个更好的选择。\r\n\r\n“住手！”萧晨终于开了口。\r\n\r\n闻言，丛虎心头一颤，但是却不敢停手。\r\n\r\n他很清楚，只要江龙活下来，就算他跟着表态拜入萧晨旗下，萧晨也不会留他。\r\n\r\n因为他可是打算对付萧晨来着，没有了那一个亿，他的命在萧晨眼里，根本不值一提。\r\n\r\n咬了咬牙，丛虎双手紧紧捏着刀柄，下了死心要取江龙的性命。\r\n\r\n可还没有刺进江龙身体，他就感觉自己手腕一疼，一个冰冷的声音也在同时传进了耳中。\r\n\r\n“你好像把我的话当成了耳边风！”\r\n\r\n劲风一动，萧晨鬼魅般的闪到了丛虎面前，一手抓着丛虎的手腕，冷着脸说道。\r\n\r\n这一刻，丛虎不敢分辨，直接往地上一跪，对着萧晨磕起了脑袋。\r\n\r\n“从今往后，双河会就是先生的，小的这条命也都是先生的，只要先生吩咐，刀山火海也在所不辞，只要是先生所指，就是海角天涯，也一定紧紧追随。”\r\n\r\n“你？”萧晨冷眼看着他，脸上却看不出喜怒。\r\n\r\n闻言，丛虎心头一颤，把头埋得更低了。\r\n\r\n江龙却不敢错过这个机会，急忙伸出指头，对天起誓言。\r\n\r\n说得是慷慨激昂，诚意十足，生怕萧晨撇下自己选择丛虎。\r\n\r\n沉默在那份誓言之后，悄然弥漫，丛虎也好，江龙也罢，一颗心全都悬在了嗓子眼。\r\n\r\n“别人养过的狗，来我这混吃混喝，谁知道吃饱喝足，獠牙又是对着谁的？”\r\n\r\n好久，萧晨才淡声开了口。\r\n\r\n一句话落，江龙猛地舒了口气。\r\n\r\n可丛虎心却沉到了谷底，颤巍巍地抬起脑袋，看到的却是萧晨那冷漠的视线。\r\n\r\n绝望，愤怒，不甘，压得他喘不过气来。\r\n\r\n可最后的求生欲却让他不自禁地捏紧了刀柄，突然从地上蹭了起来。\r\n\r\n“果然，狗就是狗，记吃不记打。”萧晨摇了摇头，一巴掌落下。\r\n\r\n咔嚓一声脆响，丛虎跳起来的身影，也在那一刻，重新扑了下去。\r\n\r\n血，顺着丛虎眼睛鼻子，扑了满脸，染了一地。\r\n\r\n“多谢先生！”江龙狠狠松了口气，对着萧晨说道。\r\n\r\n“你有两天时间，两天后，我要看到一个完全不一样的龙翼堂。你懂我的意思？”\r\n\r\n“先生放心，不用两天，双河会那些跳脚虾，小的就能收拾干净！”\r\n\r\n“很好，但愿你的手段配得上你的这份口气。”萧晨伸出了手掌。\r\n\r\n吓得江龙不禁往后一缩，却硬挺着没敢躲避，脸上还不得不堆出一脸笑意。\r\n\r\n在他肩头上拍了拍，萧晨也自顾自从大楼离开。\r\n\r\n没有过去多久，一阵急促汹涌的脚步声就从外面涌来。\r\n\r\n蒋冲这会儿，才终于带人赶回，看到那些尸体，心头一跳，急忙冲了进去。\r\n\r\n好不容易找到了江龙，急匆匆地把人扶了起来。\r\n\r\n“老大，你没事儿吧？丛虎那个混蛋呢？”\r\n\r\n“死了！”江龙勉强撑起了身子，瞥了一眼身边那具尸体。\r\n\r\n“这……”蒋冲也注意到了江龙的目光，伸手一下把丛虎的尸体翻了过来。\r\n\r\n看到丛虎那惨烈的死状，蒋冲吓得急忙缩了缩手。\r\n\r\n“先把这里打扫一下，送受伤的兄弟们治疗。至于这几个……”\r\n\r\n说着，江龙转向了还喘着气的那两个最先被萧晨甩飞的那两个沐家人身上。\r\n\r\n“他们俩先给我抓起来，等以后先生亲自发落！”\r\n\r\n“先生？什么先生？他们又是什么人？”\r\n\r\n“萧晨萧先生，我的主人，从今往后，也是我们这龙翼堂真正的主人！”\r\n\r\n江龙深吸了口气，一字一句地说道，眼中迸射着诡异而又炯然的光。',	NULL,	1731,	NULL,	NULL,	NULL,	0,	0,	1,	0,	'2022-09-18 13:44:45',	'2022-09-18 13:44:45'),
